.profile-stat { border: 5px dashed orange; }

.div { font-family: "Comic Sans MS", "Comic Sans", cursive; }

.w-6.h-6.mr-1  {
transform-origin: center;
  animation: spinScale3D 1s infinite linear, glowFlicker 0.3s infinite alternate;
  filter: filter: drop-shadow(0 0 6px cyan);
