svg { background-color: transparent}
.grid { background-color: transparent}
.ml-4 {
  border: 12px dotted blue;
  position: relative;
  animation: borderSpin 3s ease-in-out infinite alternate, borderColorChange 5s linear infinite;
}

@keyframes borderSpin {
  0%   { transform: rotate(0deg); }
  50%  { transform: rotate(10deg); }
  100% { transform: rotate(0deg); }
}

@keyframes borderColorChange {
  0%   { border-color: blue; }
  25%  { border-color: magenta; }
  75%  { border-color: yellow; }
  100% { border-color: blue; }
}

.ml-4::after {
  content: '';
  position: absolute;
  top: -50px;   
  right: -50px; 
  width: 200px; 
  height: 200px
  background: url('https://i.imgur.com/YZ9AbYb.jpeg') center/contain;
z-index: 99999;
  pointer-events: none;
}



.profile-header::before {
  z-index: 99999;
  content: '';
  position: fixed;
  top: 60%;
  left: 25%;
  transform: translateY(-50%);
  width: 4em;
  height: 4em;
  background: url('https://upload.wikimedia.org/wikipedia/commons/thumb/8/81/Twitter_Verified_Badge_Gold.svg/2048px-Twitter_Verified_Badge_Gold.svg.png') no-repeat center;
  background-size: contain;
  transform-origin: center;
  animation: spinScale3D 1s infinite linear, glowFlicker 0.3s infinite alternate;
  filter: drop-shadow(0 0 4px cyan) drop-shadow(0 0 8px magenta);
}


.profile-container {
  background-image: url('https://media.tenor.com/ZlYEwEcLfvQAAAAM/1.gif');
  background-repeat: repeat;
  border-radius: 12px;
  animation: spinOnceFromCenter 2s ease-out 1;
  transform-origin: 50% 200px;
  overflow: visible;
}


.flex.items-center.justify-between {
  display: inline-block; 
}

.flex.items-center.justify-between span {
  display: inline-block;
  animation: chaoticWave 2s infinite ease-in-out;
  position: relative;
}

.flex.items-center.justify-between span:nth-child(odd) {
  animation-delay: 0s;
}
.flex.items-center.justify-between span:nth-child(even) {
  animation-delay: 1s;
}

@keyframes chaoticWave {
  0%, 100% {
    transform: translateY(0);
  }
  25% {
    transform: translateY(-6px);
  }
  50% {
    transform: translateY(4px);
  }
  75% {
    transform: translateY(-3px);
  }
}


@keyframes colorShift {
  0% {
    background-position: 0% 50%;
  }
  50% {
    background-position: 100% 50%;
  }
  100% {
    background-position: 0% 50%;
  }
}


.activities-list {
  background: repeating-conic-gradient(
  from 0deg,
  magenta,
  cyan 120deg,
  yellow 240deg,
  magenta 360deg
);

  background-blend-mode: difference;
  padding: 1rem;
  border-radius: 10px;
  color: white;
}

p {
  color: white;
  background: linear-gradient(270deg, blue, purple, violet, magenta);
  background-size: 600% 600%;
  -webkit-background-clip: text;
  background-clip: text;
  color: transparent;
  mix-blend-mode: screen;
  animation: gradientShift 10s ease infinite;
  user-select: none;
}

@keyframes gradientShift {
  0% {
    background-position: 0% 50%;
transform: scale(1.2);
  }
  50% {
    background-position: 100% 50%;
transform: scale(1.35);
  }
  100% {
    background-position: 0% 50%;
transform: scale(1.2);
  }
}

.profile-name {
  font-size: 3rem !important;
  font-weight: 900 !important;
  color: transparent !important;
  background: repeating-conic-gradient(
    from 0deg,
    red,
    orange 10deg,
    yellow 30deg,
    green 45deg,
    blue 60deg,
    indigo 75deg,
    violet 90deg
  );
  -webkit-background-clip: text;
  background-clip: text;
  animation: swirlText 7s linear infinite, glitchText 1.5s infinite;
  letter-spacing: 0.2em;
  text-transform: uppercase;
  text-shadow:
    2px 2px 0 #ff0000,
    -2px -2px 0 #00ff00,
    2px -2px 0 #0000ff;
  filter: drop-shadow(0 0 6px cyan);
  user-select: none;
  transform-origin: center;
  display: inline-block;
}

@keyframes swirlText {
  0% {
    background-position: 0% 50%;
    transform: rotate(0deg) scale(1);
  }
  50% {
    background-position: 100% 50%;
    transform: rotate(360deg) scale(1.3);
  }
  100% {
    background-position: 0% 50%;
    transform: rotate(0deg) scale(1);
  }
}

@keyframes glitchText {
  0% {
    text-shadow:
      2px 2px 0 #ff0000,
      -2px -2px 0 #00ff00,
      2px -2px 0 #0000ff;
    clip-path: inset(0 0 0 0);
  }
  50% {
    text-shadow:
      -2px -2px 0 #ff00ff,
      2px 2px 0 #00ffff,
      -2px 2px 0 #ffff00;
    clip-path: inset(10% 0 20% 0);
  }
  100% {
    text-shadow:
      2px 2px 0 #ff0000,
      -2px -2px 0 #00ff00,
      2px -2px 0 #0000ff;
    clip-path: inset(0 0 0 0);
  }
}


.profile-avatar {
  border-radius: 50%;
width: 150px; height: 150px;
padding: 5px;

  animation: rainbowGlow 3s linear infinite, spin 5s linear infinite;

  box-shadow: 0 0 15px red;
  display: inline-block;
}

@keyframes rainbowGlow {
  0%   { box-shadow: 0 0 40px 20px red; }
  16%  { box-shadow: 0 0 40px 20px orange; }
  32%  { box-shadow: 0 0 40px 20px yellow; }
  48%  { box-shadow: 0 0 40px 20px lime; }
  64%  { box-shadow: 0 0 40px 20px cyan; }
  80%  { box-shadow: 0 0 40px 20px magenta; }
  100% { box-shadow: 0 0 40px 20px red; }
}



@keyframes spin {
  from { transform: rotate(0deg); }
  to   { transform: rotate(360deg); }
}

.profile-bio {
  padding: 10px;
  border: 5px solid transparent;
  position: relative;
  z-index: 1;
  background-color: black; 
  color: white;
  border-radius: 10px;
  overflow: hidden;
}


.profile-bio::before {
  content: '';
  position: absolute;
  top: -5px;
  left: -5px;
  right: -5px;
  bottom: -5px;
  z-index: -1;
  background: linear-gradient(45deg, red, orange, yellow, green, blue, indigo, violet);
  background-size: 400% 400%;
  animation: borderGlow 6s linear infinite;
  border-radius: 15px;
  filter: blur(5px);
}

@keyframes borderGlow {
  0% { background-position: 0% 50%; }
  50% { background-position: 100% 50%; }
  100% { background-position: 0% 50%; }
}





.profile-name {
  position: relative;
  padding-right:3 em;
}


@keyframes spinScale3D {
  0% {
    transform: rotateX(0deg) rotateY(0deg) rotateZ(0deg) scale(2);
  }
  25% {
    transform: rotateX(90deg) rotateY(90deg) rotateZ(45deg) scale(2);
  }
  50% {
    transform: rotateX(180deg) rotateY(180deg) rotateZ(90deg) scale(2);
  }
  75% {
    transform: rotateX(270deg) rotateY(270deg) rotateZ(135deg) scale(2); 
  }
  100% {
    transform: rotateX(0deg) rotateY(0deg) rotateZ(360deg) scale(2);
  }
}





.profile-header::after {
  z-index: 99999;
  content: '';
  position: fixed;
  top: 50%;
  left: 20%;
  transform: translateY(-50%);
  width: 4em;
  height: 4em;
  background: url('https://upload.wikimedia.org/wikipedia/commons/thumb/e/e4/Twitter_Verified_Badge.svg/512px-Twitter_Verified_Badge.svg.png') no-repeat center;
  background-size: contain;
  transform-origin: center;
  animation: spinScale3D 1s infinite linear, glowFlicker 0.3s infinite alternate;
  filter: drop-shadow(0 0 4px cyan) drop-shadow(0 0 8px magenta);
}

@keyframes glowFlicker {
  0% {
    filter: drop-shadow(0 0 2px #0ff) drop-shadow(0 0 4px #f0f);
  }
  25% {
    filter: drop-shadow(0 0 6px #0ff) drop-shadow(0 0 12px #ff0);
  }
  50% {
    filter: drop-shadow(0 0 8px #f0f) drop-shadow(0 0 16px #0ff);
  }
  75% {
    filter: drop-shadow(0 0 3px #ff0) drop-shadow(0 0 6px #f0f);
  }
  100% {
    filter: drop-shadow(0 0 5px #0ff) drop-shadow(0 0 10px #ff0);
  }
}



